        const map = L.map('map').setView([19, -70], 9); // Set view to the first location in geojson

        // Add OpenStreetMap tile layer
        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            maxZoom: 19,
            attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        }).addTo(map);

        const eventIcon = L.icon({
            iconUrl: 'event.png', // Path to your custom icon image
            iconSize: [32, 32],    // Adjust size of the icon
            iconAnchor: [16, 16],  // Anchor the icon's bottom center to the marker's position
            popupAnchor: [0, -32]  // Position the popup above the icon
        });

        const houseIcon = L.icon({
            iconUrl: 'house.png', // Path to your custom house icon image
            iconSize: [32, 32],    // Adjust size of the icon
            iconAnchor: [16, 32],  // Anchor the icon's bottom center to the marker's position
            popupAnchor: [0, -32]  // Position the popup above the icon (you can adjust this as needed)
        });
        

        // Add GeoJSON data to the map
        L.geoJSON(locationsGeoJSON, {
            pointToLayer: function (feature, latlng) {
                // Create a marker with a custom icon for each location
                const marker = L.marker(latlng, { icon: eventIcon });

                if (feature.properties && feature.properties.name) {
                    marker.bindTooltip(feature.properties.name, { 
                    permanent: true, 
                    direction: 'top',

                return marker;
            }
        }).addTo(map);

            pointToLayer: function (feature, latlng) {
                // Create a marker with a custom house icon for each location
                const marker = L.marker(latlng, { icon: houseIcon });

                if (feature.properties && feature.properties.name) {
                    marker.bindTooltip(feature.properties.name, { 
                    permanent: true, 
                    direction: 'top', 
                    offset: [0, -30] // Adjust this value to move the tooltip higher or lower
                });
                }
                return marker;
            }

                return { color: "#ff7800", weight: 5, opacity: 0.65 };

        let liveLocationMarker = null;

        // Function to request geolocation once and track the live location
        function trackLiveLocation() {
            if (navigator.geolocation) {
                navigator.geolocation.getCurrentPosition(function(position) {

                    // Get the initial coordinates of the user
                    initialCoords = [position.coords.latitude, position.coords.longitude];
                    // Set map view to current location

                    // Add initial live location marker
                    liveLocationMarker = L.marker(initialCoords).addTo(map);

                    setInterval(function() {
                        // Here we simulate the movement by updating the coordinates manually (for demo purposes).

                        // For this example, let's simulate small movements.

                            // Simulate movement: we add a small random offset to latitude and longitude
                            const offsetLat = (Math.random() - 0.5) * 0.0001; // Random change between -0.00005 and 0.00005
                            const offsetLng = (Math.random() - 0.5) * 0.0001; // Random change between -0.00005 and 0.00005

                            // Update the marker position
                            const newCoords = [initialCoords[0] + offsetLat, initialCoords[1] + offsetLng];
                            liveLocationMarker.setLatLng(newCoords);
                            initialCoords = newCoords; // Update initialCoords to the new position

                        }
                    }, 10000); // Update every 10 seconds
                }, function(error) {
                    console.log("Geolocation error: ", error);
                    alert("Unable to retrieve your location.");
                });
            } else {
                console.log("Geolocation is not supported by this browser.");
            }
        }

        // Call the function when the page is loaded
        window.onload = function () {
            trackLiveLocation(); // Request location tracking when the page is loaded
